import React, { useState } from 'react';

const ActualizarAlojamiento = ({ onCreate, onUpdate, onDelete }) => {
  const [formValues, setFormValues] = useState({
    name: '',
    latitud: '',
    longitud: '',
    price: '',
    images: [],
    description: '',
    bedrooms: '',
    bathrooms: '',
    estado: '',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormValues({ ...formValues, [name]: value });
  };

  const handleCreate = () => {
    onCreate(formValues);
    clearForm();
  };

  const handleUpdate = () => {
    onUpdate(formValues.id, formValues);
    clearForm();
  };

  const handleDelete = () => {
    onDelete(formValues.id);
    clearForm();
  };

  const clearForm = () => {
    setFormValues({
      name: '',
      latitud: '',
      longitud: '',
      price: '',
      images: [],
      description: '',
      bedrooms: '',
      bathrooms: '',
      estado: '',
    });
  };

  return (
    <div className="actualizar-alojamiento">
      <h2>Actualizar Alojamiento</h2>
      <form>
        <div className="form-group">
          <label>Nombre:</label>
          <input type="text" name="name" value={formValues.name} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Latitud:</label>
          <input type="text" name="latitud" value={formValues.latitud} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Longitud:</label>
          <input type="text" name="longitud" value={formValues.longitud} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Precio:</label>
          <input type="text" name="price" value={formValues.price} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Descripción:</label>
          <textarea name="description" value={formValues.description} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Dormitorios:</label>
          <input type="text" name="bedrooms" value={formValues.bedrooms} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Baños:</label>
          <input type="text" name="bathrooms" value={formValues.bathrooms} onChange={handleChange} />
        </div>
        <div className="form-group">
          <label>Estado:</label>
          <input type="text" name="estado" value={formValues.estado} onChange={handleChange} />
        </div>
        <div className="button-group">
          <button type="button" onClick={handleCreate}>Registrar</button>
          <button type="button" onClick={handleUpdate}>Actualizar</button>
          <button type="button" onClick={handleDelete}>Eliminar</button>
        </div>
      </form>
    </div>
  );
};

export default ActualizarAlojamiento;
